import React, { useEffect, useState } from "react";
import AdminServices from "./components/AdminServices";

const AdminPage = () => {
  const [services, setServices] = useState([]);

  // جلب الخدمات من قاعدة البيانات (API أو ملف محلي)
  useEffect(() => {
    fetch("/db.json")
      .then((res) => res.json())
      .then((data) => setServices(data.nurseServices || []));
  }, []);

  // تحديث الأسعار (هنا يجب ربطها بباك اند حقيقي أو json-server)
  const handleUpdate = (updatedServices) => {
    setServices(updatedServices);
    // مثال: إرسال البيانات للباك اند
    // fetch('/api/nurseServices', { method: 'PUT', body: JSON.stringify(updatedServices) })
  };

  return <AdminServices services={services} onUpdate={handleUpdate} />;
};

export default AdminPage;
